#!/usr/bin/env python

def get_base64_database_encoding(database_name):
    if database_name == "eshop":
        return ""
    elif database_name == "uni":
        return ""
    elif database_name == "social-media":
        return ""
    else:
        raise Exception(f"Sorry, but the provided database name: \"{database_name}\", is not supported.\n"
                        "You can add support in: moodle_tools.isis_database_configurations.py")


def get_database_config(database_name):
    return f"<file name=\"{database_name}.db\" path=\"/\" encoding=\"base64\"> " \
        + get_base64_database_encoding(database_name) + " </file>"

